import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();


  }

  render(){
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          My Name is DannyD
        </p>
     <button>
      Change name
     </button>
      </header>
    </div>
  );
}
}

export default App;
